INSERT INTO `house` VALUES ('1651376538123', '自由之家青年公寓', '房源离地铁站非常近，交通方便，房间设施齐全，空调热水器，无线宽带', '北京海淀区北太平庄', 65, '2022-05-01 03:42:18', '10001', 6, 1, '2022-05-02 00:00:00', '2022-06-30 00:00:00');
INSERT INTO `house` VALUES ('1651376934153', '北京三环政法研院自由宿', '房子位于北三环，高校区，交通便利，购物方便', '北京海淀区北太平庄', 328, '2022-05-01 03:48:54', '10001', 2, 1, '2022-05-02 00:00:00', '2022-06-30 00:00:00');
INSERT INTO `house` VALUES ('1651377138280', '望京soho家庭式公寓', '欧式极简主义家庭公寓，小米之家、交通便利、物业正规、专人保洁、隔音完备、设施齐全。 位于望京街十字路口，阜通地铁站相距700米，望京地铁站相距600米。', '北京朝阳区望京街', 451, '2022-05-01 03:52:18', '10001', 0, 1, '2022-05-23 00:00:00', '2022-05-31 00:00:00');
INSERT INTO `house` VALUES ('1651377247234', '奥森 日式一居', '【户型】一室一卫 房间不大 却倍感温馨  【客厅】舒服的沙发 柔软的抱枕 可以舒舒服服的看个剧 客厅还有一个沙发床可以满足加客需求  【卧室】1.8×2的榻榻米  轻松满足2人的入住需求', '北京朝阳区北沙滩7号', 488, '2022-05-01 03:54:07', '10001', 0, 1, '2022-05-23 00:00:00', '2022-05-31 00:00:00');
INSERT INTO `house` VALUES ('1651377374945', '6号线朝阳公园大悦城', '1室0厅公寓，合理舒适温馨的空间欢迎您入住～，步行范围内有各种便利设施，便利店、超市、菜市场、各类餐馆方便用餐，房源设施齐全，洗漱用品齐全，公用洗衣房有洗衣机免费使用。', '北京朝阳区石佛营路', 229, '2022-05-01 03:56:14', '10001', 0, 1, '2022-05-23 00:00:00', '2022-06-03 00:00:00');
INSERT INTO `house` VALUES ('1651377530270', '西直门/附近温馨一居', '房间内装修精致，设有厨房和独立卫生间，家电设施齐全，环境舒适。屋内简约、温馨且实用的宜家家居风格美观实用，无论您出差、旅游都让您体会到在家的感觉，免费的wifi随时供您与亲人分享快乐时光！', '北京海淀区文慧园路', 568, '2022-05-01 03:58:50', '10001', 0, 1, '2022-05-23 00:00:00', '2022-06-08 00:00:00');
INSERT INTO `house` VALUES ('1651377617452', '古北水镇别墅', '密云旅游区/古北水镇/司马台长城 整套出租 团队聚会、全家出行、亲子游、自驾游', '北京密云区古北口镇', 1899, '2022-05-01 04:00:17', '10001', 0, 1, '2022-05-30 00:00:00', '2022-06-09 00:00:00');
INSERT INTO `house` VALUES ('1651377790537', '【花筑】迈克之家', '花筑北京迈克之家四合院客栈位于海淀区小西天志强北园，近新街口外大街。2号线积水潭站到达客栈步行仅需8分钟，邻近古老的护城河及北京古城门之一德胜门', '北京海淀区小西天志强北园南院 ，近新街口外大街1号', 458, '2022-05-01 04:03:10', '10001', 0, 1, '2022-05-23 00:00:00', '2022-06-03 00:00:00');
INSERT INTO `house` VALUES ('1651377925984', '温馨小窝 可住2人', '很开心你喜欢我的房子, 如果不巧此房已被其他朋友预定，你可以点击我的头像，随意挑选我的珍藏~ 我们的房源是一套奶油系 治愈轻法式混搭浪漫优雅诧寂风一居室。', '成都武侯区万虹路752号', 358, '2022-05-01 04:05:25', '10002', 1, 1, '2022-05-09 00:00:00', '2022-06-03 00:00:00');
INSERT INTO `house` VALUES ('1651378340748', '迎兴公寓', '位于成都东客站（高铁站）东广场斜对面300米东方新城2期小区，步行10分钟左右。', '成都成华区邛崃山路东方新城2期', 226, '2022-05-01 04:12:20', '10002', 0, 1, '2022-05-16 00:00:00', '2022-06-16 00:00:00');

